INSERT INTO `wines` VALUES (1,'Monsape - Field Blend - Malbec Verdot','Monsape Finca Los Nobles - Field Blend - Malbec Verdot es un vino unico. De color rojo violaceo profundo con reflejos rubi, sus aromas son expresivos e intensos, con notas de frutos rojos y negros, especias dulces, flores y suaves ahumados de la crianza. En boca es franco y voluptuoso, con una frescura vivaz que habla de la añada, apoyada en su caracter frutal. De paladar amplio y profundo, con taninos finos y un final persistente en el que se puede apreciar su complejidad. Es un tinto de terroir, con sentido de pertenencia y muy representativo de la familia.','Es ideal para disfrutar con platos especiales a base de las mejores carnes asadas como bife de Kobe, ojo de bife Angus o gigot de cordero patagónico.',6282,'5,70 g/l','3,15 g/l','14,50%',2500.00,15.00,'/VinosJson/dato2.jpg',1,2,'Entre 15°C y 18°C.',21),(2,'Monsape Finca Los Nobles - Chardonnay','Monsape Finca Los Nobles - Chardonnay es un blanco único, de color amarillo brillante con reflejos dorados. Sus aromas son intensos y equilibrados, con notas de frutas blancas, miel, manzanilla y toques florales. En boca es franco y refrescante, vivaz y voluptuoso, con carácter nítido. De paladar amplio y profundo, tiene un final persistente y mineral con dejos de levaduras. Es un blanco pensado para la guarda que refleja el espíritu del viñedo y de la familia.','Es ideal para disfrutar con platos especiales como una merluza austral con arroz salteado, risotto de langostinos, o bien tabla de quesos.',6427,'6 g/l','1,59 g/l','14,50%',13000.00,25.00,'/VinosJson/dato3.jpg',1,3,'Entre 8ºC y 10ºC',294),(3,'Monsape Gala 1 - Malbec','Monsape Gala 1 es un vino innovador por fuera y por dentro. De color rojo violáceo intenso y brillante. Sus aromas son sutiles y equilibrados, con notas de frutas rojas y especias frescas. En boca es ágil y expresivo, voluptuoso, con fuerza y agarre que le augura un gran potencial. De paladar franco y moderno, vibrante, jugoso y con buena concentración de fruta. En su final persistente se siente la madera muy bien integrada. Es un Malbec-blend pionero, con mucha vida por delante.','Es ideal para disfrutar con platos especiales como una cotoletta alla milanese, o un solomillo de cerdo con puré de batatas.',49065,'5,63 g/l','2,72 g/l','14,60%',1200.00,15.00,'/VinosJson/dato5.jpg',2,2,'Entre 15ºC y 18ºC.',98),(4,'Monsape Finca Los Nobles - Cabernet Bouchet','Monsape Finca Los Nobles - Field Blend - Cabernet Bouchet es un vino robusto, de color rojo rubí profundo con reflejos caoba. Sus aromas son equilibrados y elegantes, con notas de frutos maduros, especias, moca y suaves ahumados de la crianza. En boca es imponente, de frescura equilibrada y carácter especiado intenso. De buen cuerpo, maduro, con taninos finos y firmes, y un final persistente en el que se aprecia su complejidad. Es un tinto de terroir, con gran potencial de guarda y orgullo de la familia.','Es ideal para disfrutar con platos elaborados como conejo asado con espinacas y vegetales, o bien cordero braseado con hierbas.',5007,'3,50 g/l','2,90 g/l','14,30%',900.00,5.00,'/VinosJson/dato4.jpg',1,2,'Entre 15ºC y 18ºC.',479),(5,'Monsape Gala 2','Monsape Gala 2 es un vino sofisticado y moderno con espíritu clásico. De color rojo bordó profundo y brillante, sus aromas son delicados y armónicos, con notas de frutos del bosque y especias. En boca es voluptuoso y fresco, con buen cuerpo y taninos firmes. De paladar consistente, con carácter elegante y expresivo, y suaves toques vegetales típicos del Cabernet Sauvignon. En su largo y atractivo final se sienten los ahumados de la crianza totalmente integrados. Es un tinto que va a ganar complejidad con la guarda.','Ideal para disfrutar con platos especiales como un magret de pato con verduras asadas, o un cabrito al asador con humita cremosa.',27089,'6 g/l','2,84 g/l','14,50%',1050.00,15.00,'/VinosJson/dato6.jpg',2,2,'Entre 15ºC y 18ºC.',470),(6,'Monsape Gala 4 - Cabernet Franc','Monsape Gala 4 es un vino actual concebido a partir de la experiencia. De color rojo rubÃ­ intenso y brillante. Sus aromas son sutiles y delicados, con notas a frutas rojas maduras, especias y hierbas secas. En boca es fluido y equilibrado, con taninos firmes. De paladar franco y fresco, jugoso y amable, con un carácter vegetal elegante y un final persistente en el que se siente el aporte del roble. Es un blend con tipicidad y buen potencial de guarda.','Ideal para disfrutar con platos especiales como lomo con marinada de verduras, o bife dry aged con ensalada de rúcula y parmesano.',12405,'5,70 g/l','2,64 g/l','14,40%',1800.00,25.00,'/VinosJson/dato8.jpg',2,2,'Entre 15ºC y 18ºC.',814),(7,'Monsape - Riesling ','Monsape Riesling Las Compuertas es pionero entre los varietales argentinos. De color amarillo brillante con reflejos dorados y verdosos. Sus aromas son equilibrados y expresivos; combinan frutas tropicales y flores silvestres. En boca es vivaz y refrescante, con buen cuerpo. De paladar franco y complejo, con tensión y un carácter floral que habla de su tipicidad, pero también de su personalidad.','Es ideal para disfrutar con platos intensos y especiados al estilo Thai, como el pad thai. O bien con cochinillo al horno con vegetales.',10000,'5,33 g/l','1,48 g/l','12,90%',1750.00,30.00,'/VinosJson/dato9.jpg',3,1,'Entre 8ºC y 11ºC.',479),(8,'Monsape - Grand Pinot Noir','Monsape - Grand Pinot Noir - La Consulta es un auténtico vino de terruño. De color rojo rubí­ brillante y poco profundo, sus aromas son delicados, con notas de frutos rojos y especias. En boca es vivaz y equilibrado, de textura fina, paladar franco y refrescante; con carácter complejo y final profundo en el que se perciben integrados los tostados de la crianza en barricas de roble francés. Es un exponente varietal con personalidad y potencial de guarda.','Es ideal para disfrutar con platos especiales como langostinos grillados, magret de canard a la pimienta, o bien pasta seca ai funghi.',10000,'5,78 g/l','2,59 g/l','14,20%',2500.00,35.00,'/VinosJson/dato10.jpg',3,2,'Entre 14ºC y 16ºC. Sugerimos decantar el vino una hora antes de beberlo.',58),(9,'Monsape - Malbec','Monsape - Malbec - Terroir Los Miradores es un vino que refleja el espíritu de un viñedo nuevo. De color rojo violáceo profundo y brillante. Sus aromas son intensos, con notas de frutos del bosque, especias y hierbas frescas. En boca es voluptuoso y consistente, con taninos vivaces y buen agarre. De paladar franco y expresivo, con carácter y tipicidad, y un final con dejo floral tan persistente como refrescante. Es un tinto moderno, con personalidad y potencial para ganar complejidad con la guarda.','Es ideal para disfrutar con platos especiales como pastas rellenas de cordero en sus propios jugos, paleta de novillo roti con batatas y zanahorias, o risotto de remolachas.',10000,'5,40 g/l','2,80 g/l','14,60%',1010.00,25.00,'/VinosJson/dato12.jpg',3,2,'Entre 15°C y 18°C. Sugerimos decantar el vino al menos una hora antes de beberlo.',665),(10,'Monsape - Malbec D.O.C.','Monsape - Malbec D.O.C es uno de los primeros vinos argentinos con De - nominación de Origen. De color rojo violáceo profundo y brillante, sus aromas son equilibrados, con notas de frutas rojas y negras, y especias dulces. En boca es refrescante y voluptuoso, con taninos finos y delicados. De paladar franco y expresivo, con carácter y tipicidad, y un final profundo con suaves tonos ahumados de la crianza en barricas de roble. Es un gran exponente del varietal y de su terruño, con gran potencial de guarda.','Ideal para disfrutar con platos especiales como un rack de cordero con hongos salteados, o bien ojo de bife madurado con risotto de quinoa, y tabla de quesos semiduros.',10000,'5,48 g/l','2,20 g/l','14%',1900.00,20.00,'/VinosJson/dato11.jpg',3,2,'Entre 15ºC y 18ºC.',798),(11,'Monsape - Sauvignon Blanc','Monsape Sauvignon Blanc es un vino blanco de color amarillo pálido y brillante con reflejos acerados. Sus aromas son delicados y expresivos, con notas de frutas blancas y cítricas. En boca es vivaz y refrescante, de paladar franco y equilibrado; voluptuoso, con un carácter herbal que lo distingue y un paso por boca vibrante. Es un vino de gran tipicidad varietal que habla del terruño en el que nace.','Ideal para acompañar ostras, langostinos grillados, o bien pastas rellenas con salsas de crema y hierbas.',10000,'6,18 g/l','2,81 g/l','13,40%',5455.00,55.00,'/VinosJson/dato13.jpg',4,1,'Entre 8ºC y 10ºC.',642),(12,'Monsape - Chardonnay','Monsape - Chardonnay es un blanco de color amarillo intenso brillante. Sus aromas son armónicos, con notas de frutas blancas y cítricas, y dejos florales. De entrada en boca fresca, paladar franco y vivaz, con buen volumen y textura incipiente que aporta carácter. Su final es expresivo y delicado, también persistente, y recuerda a jazmín y flores de acacia. Es uno de los exponentes del varietal referente de la Argentina.','Es ideal para acompañar preparaciones delicadas a base de pescados como sashimi de salmón, trucha grillada o atún rojo sellado con arroz salteado con vegetales.',10000,'7,13 g/l','1,50 g/l','13,70%',988.00,20.00,'/VinosJson/dato13.jpg',4,1,'Entre 8°C y 10°C.',133),(13,'Monsape - Pinot Noir','Monsape - Grand Pinot Noir - La Consulta es un auténtico vino de terruño. De color rojo rubí brillante y poco profundo, sus aromas son delicados, con notas de frutos rojos y especias. En boca es vivaz y equilibrado, de textura fina, paladar franco y refrescante; con carácter complejo y final profundo en el que se perciben integrados los tostados de la crianza en barricas de roble francés. Es un exponente varietal con personalidad y potencial de guarda.','Es ideal para disfrutar con platos especiales como langostinos grillados, magret de canard a la pimienta, o bien pasta seca ai funghi.',10000,'5,78 g/l','2,50 g/l','14,20%',770.00,10.00,'/VinosJson/dato14.jpg',4,2,'Entre 14°C y 16°C. Sugerimos decantar el vino una hora antes de beberlo.',609),(14,'Monsape Malbec','Monsape - Malbec es un tinto de color rojo violáceo brillante. Sus aromas son intensos y amables, con notas que recuerdan a frutas rojas, y tonos algo florales y especiados. En boca es generoso, fluido y expresivo, con taninos incipientes. De paladar franco y paso refrescante, con buen cuerpo y carácter. Su final es profundo y ní­tido, con la crianza totalmente integrada. Es un vino insignia de la variedad y con buen potencial de guarda.','Ideal para disfrutar con carnes rojas a la parrilla como entraña con purÃ© o bien ojo de bife con papas rústicas al romero.',10000,'5,33 g/l','2,55 g/l','14,20%',1020.00,20.00,'/VinosJson/dato15.jpg',4,2,'Entre 16°C y 18°C.',849),(15,'Monsape - Rose','Monsape - Rose es un vino de color tenue y brillante con reflejos cobrizos. Sus aromas son vibrantes, con notas de frutas rojas, membrillo, miel y flores blancas. En boca es vivaz y refrescante, de paladar franco y tenso. Es un rosado voluptuoso, con agarre y un carácter expresivo y bien sutil. De buen cuerpo, final persistente y delicado. Es un rosado innovador y original que va evolucionando desde el viñedo.','Es ideal para disfrutar con entradas de mar como el pulpo a la gallega, rabas y chipirones fritos, o bien tiradito de atún rojo.',10000,'7,30 g/l','1,70 g/l','13,10%',850.00,15.00,'/VinosJson/dato19.jpg',4,3,'Entre 10°C y 14°C.',503),(16,'Monsape - De Sangre','Monsape De Sangre es un tinto de color rojo bordó brillante con reflejos rubí. Sus aromas son sutiles y equilibrados, con notas vegetales y especiadas. En boca es voluptuoso y expresivo, con taninos incipientes. De paladar franco y fresco, con buen cuerpo y vivacidad, y carácter amable con final persistente en el que conviven la tipicidad del Cabernet con los ahumados de la crianza. Es un blend con potencial de guarda que refleja el espí­ritu de la familia.','Ideal para disfrutar con un risotto de hongos o unas baby back ribs (costillitas) con choclo y papas asadas a la leña.',10000,'5,25 g/l','2,30 g/l','14,20%',500.00,10.00,'/VinosJson/dato17.jpg',4,2,'Entre 16°C y 18°C.',838),(17,'Monsape - Cabernet Sauvignon','Monsape - Cabernet Sauvignon es un tinto de color rojo rubí­ profundo y brillante. Sus aromas son sutiles y equilibrados, con notas de frutos negros, especias y cuero. En boca es jugoso y expresivo, con taninos finos y firmes que se agarran. De paladar franco y fresco, con buen cuerpo y carácter vivaz, y final profundo en el que se aprecian los ahumados de la crianza en barricas de roble. Es un vino referente del varietal, con gran potencial de guarda.','Es ideal para disfrutar con carnes de caza de sabores intensos como ciervo o jabalí marinado con hierbas y acompaÃ±ados de vegetales asados.',10000,'5,33 g/l','2,50 g/l','13,80%',1010.00,10.00,'/VinosJson/dato16.jpg',4,2,'Entre 16°C y 18°C.',943),(18,'Monsape - Del Alma','Monsape Del Alma es un blend blanco de color amarillo brillante con reflejos acerados. Sus aromas son integrados y delicados, con notas de frutas blancas y levaduras. En boca es refrescante, con fuerza y profundidad. De paladar franco y voluptuoso, textura incipiente y un carácter floral muy sutil. Buen cuerpo y final complejo. Es un blend blanco con una composición varietal muy original y personalidad propia.','Ideal para disfrutar con pescados grasos a la parrilla, como dorado o surub\' con papas y vegetales asados.',10000,'6,60 g/l','1,43 g/l','13,60%',1022.00,25.00,'/VinosJson/dato20.jpg',4,1,'Entre 8°C y 12°C.',108),(19,'Monsape Brut','Monsape - Brut es un espumoso de color amarillo brillante con reflejos verdosos. Sus aromas son delicados y elegantes, con notas de frutas maduras, especias y pan tostado. En boca es refrescante, de paladar amplio y equilibrado, con burbujas finas y persistentes. Con carácter propio, buena estructura y un final de boca amable y tenso. Es un vino especial, concebido para celebrar momentos únicos.','Es ideal para disfrutar con ostras gratinadas, langostinos grillados o un risotto verde con hongos.',10000,'6,60 g/l','7,10 g/l','12,40%',1555.00,15.00,'/VinosJson/dato22.jpg',5,4,'Entre 8°C y 10°C.',701),(20,'Monsape - Brut Nature','Monsape - Brut es un espumoso de color amarillo brillante con reflejos verdosos. Sus aromas son delicados y elegantes, con notas de frutas maduras, especias y pan tostado. En boca es refrescante, de paladar amplio y equilibrado, con burbujas finas y persistentes. Con carácter propio, buena estructura y un final de boca amable y tenso. Es un vino especial, concebido para celebrar momentos únicos.','Es ideal para disfrutar con ostras gratinadas, langostinos grillados o un risotto verde con hongos.',10000,'6,60 g/l','7,10 g/l','12,40%',8450.00,35.00,'/VinosJson/dato23.jpg',5,4,'Entre 8°C y 10°C.',179),(21,'Monsape Boheme - Brut Nature','Monsape Boheme - Brut Nature es un espumoso de color dorado brillante. Sus aromas son delicados y elegantes, con notas que recuerdan a frutas blancas, frutos secos y pan tostado. En boca es vivaz y refrescante, de paladar franco y equilibrado, con burbujas finas y persistentes. Es de carácter complejo, con buena estructura y fineza en su paso por boca; un vino sofisticado concebido para celebrar momentos únicos.','Es ideal para disfrutar con ostras gratinadas, langostinos grillados o un risotto verde con hongos.',10000,'5,51 g/l','3,76 g/l','13,20%',1500.00,25.00,'/VinosJson/dato21.jpg',5,4,'Entre 8°C y 10°C.',899),(22,'Monsape - Prestige - Rose','Monsape - Prestige Rose es un espumoso de color rosado pálido y brillante. Sus aromas son equilibrados y sutiles, con notas de frutas rojas y especias. En boca es refrescante, de paladar amplio y vibrante, con burbujas finas y persistentes. Con carácter propio, buena estructura y un final de boca amable y tenso. Es un vino especial, concebido para celebrar momentos únicos.','Ideal para disfrutar con ravioles de espinaca y ricota, o una tradicional paella de langostinos, pollo y vegetales.',10000,'5,93 g/l','5,64 g/l','12,90%',5500.00,20.00,'',5,4,'Entre 8°C y 10°C.',957),(23,'-